import React, { useState } from 'react';
import './App.css';

function App() {
  return(
    <div className="App">
      {createScene}
    </div>
  );
}

function initScenes() {
  var gameData = new Set();
  const allScenes = new Set(["menu", "catalog", "editor", "finale"]);
  allScenes.forEach(element => {
    gameData.append(new Scene(element));
  });
  return gameData;
}

class Scene extends React.Component {
  constructor(type) {
    super();
    this.state = {
      display: false,
    };
    this.name = type;
  }

  render() {
    switch(this.name) {
      case "menu":
        return;
      case "catalog":
        return;
      case "editor":
        return;
      case "finale":
        return;
      default:
        return;
    }
  }
}

export default App;
